  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:33.328550\",\n\t\"name\": \"lostwood-wetland-management-district-annual-narrative-report-calendar-year-1984\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lostwood
  Wetland Management District outlines accomplishments during the 1984 calendar year.
  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is discussed. Wetland Management District administration is outlined;
  information about personnel, funding, and safety is given. Habitat management is
  also covered; subjects include wetlands, croplands, grasslands, grazing, fire management,
  pest control, water rights, and WPA easements. The wildlife section of the report
  discusses wildlife diversity, migratory birds, and raptors. The public uses of the
  District described in this report include interpretive programs, recreational uses,
  and law enforcement. The equipment and facilities section of the report provides
  information about new construction, and rehabilitation. Items of interest are provided
  at the end. A brief narrative on Shell Lake National Wildlife Refuge is also included.
  Photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
